import React from 'react';
import { Link } from 'react-router-dom'

const Home = () => {
    return ( 
        <div>
            <p><b>What would you like to do?</b></p>
            <Link to='/random' style={{color: 'grey', textDecoration: 'none'}}>
                <div className='box'>
                    <b style={{textDecoration: 'underline'}}>Practice with random verbs</b>
                    <p>Translate randoms verbs, tenses, and forms</p>
                </div>
            </Link>
            <Link to='/options' style={{color: 'grey', textDecoration: 'none'}}>
                <div className='box'>
                    <b style={{textDecoration: 'underline'}}>Choose the verbs you want</b>
                    <p>Select your verbs, tenses, and forms</p>
                </div>
            </Link>
        </div>
     );
}

export default Home;
